import React, { Component } from 'react';
import Link from 'next/link';
class index extends Component {
  static async getInitialProps() {
    // return ({
    //   time: new Date().toISOString()
    // })
    // return new Promise((resolve, reject) => {
    //   setInterval(() => {
    //     resolve({ time: new Date().toISOString() })
    //   }, 3000);
    // })



    let response = await fetch("https://5ec86440155c130016a909c5.mockapi.io/repartidor");
    let data = await response.json();
    return {
      repartidores: data
    }
  }

  constructor(props) {
    super(props);
    this.state = {
      repartidores: props.repartidores
    }
  }

  componentDidMount() {
  }

  componentWillUnmount() {
  }


  render() {
    return (
      <div>
        <Link href={"/clientes"}>CLIENTES</Link>
        <ul>
          {this.state.repartidores.map(r => (<li key={r.id}>{r.rep_nom} {r.rep_ape}</li>))}
        </ul>
      </div>)
  }
}

export default index;
